import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Upload from "./artifacts/contracts/Upload.sol/Upload.json";
import { useState, useEffect } from "react";
import { ethers } from "ethers";
import FileUpload from "./components/FileUpload";
import Display from "./components/Display";
import Modal from "./components/Modal";
import Header from "./components/header";
import Feedback from "./components/Feedback";
import "./App.css";
import Disease from "./components/dise";

const accountNumbers = [
  "0xf39Fd6e51aad88F6F4ce6aB8827279cffFb92266",
  "0x70997970C51812dc3A010C7d01b50e0d17dc79C8",
  "0xe7f1725E7734CE288F8367e1Bb143E90bb3F0512",
  0x3C44CdDdB6a900fa2b585dd299e03d12FA4293BC,
  0x90F79bf6EB2c4f870365E785982E1f101E93b906,
];

function App() {
  const [account, setAccount] = useState("");
  const [contract, setContract] = useState(null);
  const [provider, setProvider] = useState(null);
  const [modalOpen, setModalOpen] = useState(false);
  const [uploadedRecords, setUploadedRecords] = useState([]);
  const [userName, setUserName] = useState("");
  const [isNameSet, setIsNameSet] = useState(false);
  const [userRole, setUserRole] = useState(0); // Default to UserRole.Patient
  const [userRoles, setUserRoles] = useState({});

  useEffect(() => {
    const loadProvider = async () => {
      try {
        const provider = new ethers.providers.Web3Provider(window.ethereum);
        if (provider) {
          window.ethereum.on("chainChanged", () => {
            window.location.reload();
          });

          window.ethereum.on("accountsChanged", () => {
            window.location.reload();
          });

          await provider.send("eth_requestAccounts", []);
          const signer = provider.getSigner();
          const address = await signer.getAddress();
          setAccount(address);
          const contractAddress = "0xDc64a140Aa3E981100a9becA4E685f962f0cF6C9";
          const contract = new ethers.Contract(contractAddress, Upload.abi, signer);
          setContract(contract);
          setProvider(provider);
          fetchUploadedRecords(contract, address);
          const name = await contract.getName(address);
          const role = await contract.getUserRole(address);
          if (name) {
            setUserName(name);
            setIsNameSet(true);
          }
          setUserRole(role);
          setUserRoles({ ...userRoles, [address]: role });
        } else {
          console.error("Metamask is not installed");
        }
      } catch (error) {
        console.error("Error loading provider:", error);
      }
    };

    loadProvider();
  }, []);

  const fetchUploadedRecords = async (contract, address) => {
    try {
      const records = await contract.display(address);
      setUploadedRecords(records);
    } catch (error) {
      console.error("Error fetching uploaded records:", error);
    }
  };

  const setUserRoleAndName = async () => {
    try {
      if (!contract || !account || !userName) {
        console.error("Contract, account, or userName not available");
        return;
      }

      // Call the setNameAndRole function in the smart contract
      const tx = await contract.setNameAndRole(userName, userRole);
      await tx.wait();

      // Update the userRoles state locally
      setUserRoles({ ...userRoles, [account]: userRole });

      // Set the user's name locally
      setIsNameSet(true);

      console.log("Name and Role set successfully");
    } catch (error) {
      console.error("Error setting name and role:", error);
    }
  };

  const [accessAddresses, setAccessAddresses] = useState([]);

  useEffect(() => {
    const loadAccessAddresses = async () => {
      try {
        if (contract) {
          const addresses = await contract.getAccessAddresses();
          setAccessAddresses(addresses);
        }
      } catch (error) {
        console.error("Error fetching access addresses:", error);
      }
    };

    loadAccessAddresses();
  }, [contract]);

  return (
    <Router>
      {!modalOpen && (
        <button className="share" onClick={() => setModalOpen(true)}>
          Share
        </button>
      )}
      {modalOpen && <Modal setModalOpen={setModalOpen} contract={contract} />}

      <div className="App">
        <Header />
        <div>
          <div>
            <p>Username: {userName}</p>
            <p>Account Address: {account}</p>
          </div>

          {!isNameSet ? (
            <div>
              <input
                type="text"
                placeholder="Your Name"
                value={userName}
                onChange={(e) => setUserName(e.target.value)}
              />
              <select
                value={userRole}
                onChange={(e) => setUserRole(e.target.value)}
              >
                <option value={0}>Patient</option>
                <option value={1}>Doctor</option>
              </select>
              <button onClick={setUserRoleAndName}>
                Set Name and Role
              </button>
            </div>
          ) : null}
        </div>
        <div>
          <h3>Access Addresses:</h3>
          <ul>
            {accessAddresses.map((address, index) => (
              <li key={index}>{address}</li>
            ))}
          </ul>
        </div>

        <Routes>
          <Route
            path="/"
            element={
              <FileUpload account={account} provider={provider} contract={contract} />
            }
          />
          <Route
            path="/display"
            element={<Display contract={contract} account={account} />}
          />
          <Route
            path="/feedback"
            element={
              <Feedback
                contract={contract}
                account={account}
                uploadedRecords={uploadedRecords}
                userName={userName}
              />
            }
          />
          <Route path="/disease" element={<Disease contract={contract} account={account} />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
